import React from 'react';
import { Container, Columns } from 'react-bulma-components';

function Portfolio() {
  return (
    <section className="my-5" style={{width: 800, margin: "auto"}}>
      <h1 id="portfolio">Portfolio</h1>
      <div className="my-2">

      <div class="columns">
        <div class="column is-one-quarter color-primary">project 1</div>
        <div class="column is-one-quarter">project 2</div>
        <div class="column is-one-quarter">project 3</div>
        <div class="column is-one-quarter">project 3</div>
      </div>

      </div>
    </section>
  );
}

export default Portfolio;
